import styled from "styled-components";
import photoPlaceHolder from "../images/photoPlaceHolder.webp";

const Card = styled.div`
  background-color: var(--dark-blue);
  display: flex;
  width: 90%;
  align-items: top;
  box-sizing: border-box;
  padding: 10px;
`;

const InfoDiv = styled.div`
  margin: 0 20px;
  padding: 0;
  color: var(--white);
  overflow: hidden;
  width: 100%;
`;

const Photo = styled.img`
  height: 100px;
  margin: auto 0;
`;

const Name = styled.h1`
  font-size: 18px;
  margin: 0;
`;

const Info = styled.p`
  font-size: 13px;
  margin: 5px 0;
  padding: 0;
  width: 100%;
`;

const Dropdown = styled.div`
  position: relative;
  width: 200px;
  border: solid red;
`;

const DropdownButton = styled.button``;

const DropdownContent = styled.div`
  position: absolute;
`;
const A = styled.a`
  font-size: 10px;
`;

function SearchCard({ player }) {
  const generateSecondary = (positions) => {
    if (positions) {
      return positions
        .replace(/\[|\]|'/g, "")
        .split(", ")
        .join(", ");
    } else {
      return "None";
    }
  };
  return (
    <Card>
      <Photo src={photoPlaceHolder}></Photo>
      <InfoDiv>
        <Name>{player.first_name + " " + player.last_name}</Name>
        <Info>{"Level: " + player.level}</Info>
        <Info>{"Primary Position: " + player.primary_position}</Info>
        <Info>
          {"Secondary Position: " +
            generateSecondary(player.secondary_position)}
        </Info>
        <Info>{"Run Value: " + Math.round(player.run_value * 100) / 100}</Info>
      </InfoDiv>
      <Dropdown>
        <DropdownButton>Select</DropdownButton>
        <DropdownContent>
          <A>Pitcher</A>
          <A>Catcher</A>
          <A>1st Base</A>
          <A>2nd Base</A>
          <A>3rd Base</A>
          <A>Shortstop</A>
          <A>Left Field</A>
          <A>Center Field</A>
          <A>Right Field</A>
        </DropdownContent>
      </Dropdown>
    </Card>
  );
}

export default SearchCard;

